import React from 'react';

function SignIn() {
  return (
    <div>
      <h2>Вход</h2>
      <form>
        <div>
          <label>Имя пользователя:</label>
          <input type="text" />
        </div>
        <div>
          <label>Пароль:</label>
          <input type="password" />
        </div>
        <button type="submit">Войти</button>
      </form>
    </div>
  );
}

export default SignIn;
